DROP DATABASE IF EXISTS flevosap;

CREATE DATABASE flevosap;

USE flevosap;

CREATE TABLE images (
                        id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
                        data           MEDIUMBLOB          NOT NULL,
                        filetype        VARCHAR(32)       NOT NULL
);

